PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "BreedingRecord" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "crossId" TEXT NOT NULL,
    "crossDate" DATETIME NOT NULL,
    "femalePlantId" TEXT NOT NULL,
    "malePlantId" TEXT NOT NULL,
    "crossType" TEXT NOT NULL,
    "pollinationMethod" TEXT,
    "seedsProduced" INTEGER,
    "germinationRate" REAL,
    "seedlingCount" INTEGER,
    "f1PlantsRaised" INTEGER,
    "selectionCriteria" TEXT NOT NULL DEFAULT '[]',
    "selectedPlants" TEXT NOT NULL DEFAULT '[]',
    "notes" TEXT,
    "photos" TEXT NOT NULL DEFAULT '[]',
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL, "crossCategory" TEXT, "targetTraits" TEXT,
    CONSTRAINT "BreedingRecord_femalePlantId_fkey" FOREIGN KEY ("femalePlantId") REFERENCES "Plant" ("id") ON DELETE RESTRICT ON UPDATE CASCADE,
    CONSTRAINT "BreedingRecord_malePlantId_fkey" FOREIGN KEY ("malePlantId") REFERENCES "Plant" ("id") ON DELETE RESTRICT ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "Treatment" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "name" TEXT NOT NULL,
    "type" TEXT NOT NULL,
    "brand" TEXT,
    "composition" TEXT,
    "applicationRate" TEXT,
    "frequency" TEXT,
    "notes" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL
);
CREATE TABLE IF NOT EXISTS "Vendor" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "name" TEXT NOT NULL,
    "type" TEXT NOT NULL,
    "location" TEXT,
    "country" TEXT,
    "reputationScore" REAL,
    "specialties" TEXT NOT NULL DEFAULT '[]',
    "contactInfo" TEXT,
    "website" TEXT,
    "instagram" TEXT,
    "notes" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL
);
CREATE TABLE IF NOT EXISTS "Purchase" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "vendorId" TEXT NOT NULL,
    "purchaseDate" DATETIME NOT NULL,
    "totalCost" REAL NOT NULL,
    "plantCount" INTEGER NOT NULL,
    "invoiceNumber" TEXT,
    "trackingNumber" TEXT,
    "plantIds" TEXT NOT NULL DEFAULT '[]',
    "notes" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    CONSTRAINT "Purchase_vendorId_fkey" FOREIGN KEY ("vendorId") REFERENCES "Vendor" ("id") ON DELETE RESTRICT ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "Location" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "name" TEXT NOT NULL,
    "type" TEXT NOT NULL,
    "zone" TEXT,
    "shelf" TEXT,
    "position" TEXT,
    "lightLevel" TEXT,
    "humidity" REAL,
    "temperature" REAL,
    "capacity" INTEGER,
    "currentOccupancy" INTEGER NOT NULL DEFAULT 0,
    "notes" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL
, "airflow" TEXT, "co2" REAL, "dli" REAL, "fanSpeed" TEXT, "growLights" TEXT, "photoperiod" TEXT, "pressure" REAL, "vpd" REAL, "lastSensorSync" DATETIME, "sensorPushId" TEXT);
CREATE TABLE IF NOT EXISTS "Species" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "genus" TEXT NOT NULL,
    "species" TEXT NOT NULL,
    "section" TEXT,
    "commonNames" TEXT NOT NULL DEFAULT '[]',
    "nativeRange" TEXT,
    "conservationStatus" TEXT,
    "citesListing" TEXT,
    "keyTraits" TEXT NOT NULL DEFAULT '[]',
    "description" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL
);
CREATE TABLE IF NOT EXISTS "FloweringCycle" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "plantId" TEXT NOT NULL,
    "spatheEmergence" DATETIME,
    "femaleStart" DATETIME,
    "femaleEnd" DATETIME,
    "maleStart" DATETIME,
    "maleEnd" DATETIME,
    "spatheClose" DATETIME,
    "pollenCollected" BOOLEAN NOT NULL DEFAULT false,
    "pollenQuality" TEXT,
    "pollenStored" BOOLEAN NOT NULL DEFAULT false,
    "pollenStorageDate" DATETIME,
    "crossesAttempted" TEXT NOT NULL DEFAULT '[]',
    "seedsProduced" INTEGER,
    "temperature" REAL,
    "humidity" REAL,
    "notes" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL,
    CONSTRAINT "FloweringCycle_plantId_fkey" FOREIGN KEY ("plantId") REFERENCES "Plant" ("id") ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "Genetics" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "plantId" TEXT NOT NULL,
    "raNumber" TEXT,
    "ogNumber" TEXT,
    "provenance" TEXT,
    "ploidy" TEXT,
    "dnaBarcode" TEXT,
    "sequenceData" TEXT,
    "breedingValue" REAL,
    "inbreedingCoeff" REAL,
    "traitPredictions" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL,
    CONSTRAINT "Genetics_plantId_fkey" FOREIGN KEY ("plantId") REFERENCES "Plant" ("id") ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "Measurement" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "plantId" TEXT NOT NULL,
    "measurementDate" DATETIME NOT NULL,
    "leafLength" REAL,
    "leafWidth" REAL,
    "petioleLength" REAL,
    "internodeLength" REAL,
    "primaryVeinColor" TEXT,
    "flushColor" TEXT,
    "petioleColor" TEXT,
    "texture" TEXT,
    "vigorScore" INTEGER,
    "leafCount" INTEGER,
    "height" REAL,
    "notes" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    CONSTRAINT "Measurement_plantId_fkey" FOREIGN KEY ("plantId") REFERENCES "Plant" ("id") ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "Photo" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "plantId" TEXT NOT NULL,
    "url" TEXT NOT NULL,
    "thumbnailUrl" TEXT,
    "dateTaken" DATETIME NOT NULL,
    "growthStage" TEXT,
    "photoType" TEXT NOT NULL,
    "metadata" TEXT,
    "aiAnalysis" TEXT,
    "notes" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    CONSTRAINT "Photo_plantId_fkey" FOREIGN KEY ("plantId") REFERENCES "Plant" ("id") ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "Trait" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "plantId" TEXT NOT NULL,
    "category" TEXT NOT NULL,
    "traitName" TEXT NOT NULL,
    "value" TEXT,
    "expressionLevel" REAL,
    "inheritancePattern" TEXT,
    "observationDate" DATETIME NOT NULL,
    "notes" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL,
    CONSTRAINT "Trait_plantId_fkey" FOREIGN KEY ("plantId") REFERENCES "Plant" ("id") ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "GrowthMetric" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "plantId" TEXT NOT NULL,
    "date" DATETIME NOT NULL,
    "leafCount" INTEGER,
    "largestLeafLength" REAL,
    "largestLeafWidth" REAL,
    "averageLeafSize" REAL,
    "newGrowthRate" TEXT,
    "hasStuntedGrowth" BOOLEAN NOT NULL DEFAULT false,
    "hasCurledLeaves" BOOLEAN NOT NULL DEFAULT false,
    "hasYellowing" BOOLEAN NOT NULL DEFAULT false,
    "hasEdgeBurn" BOOLEAN NOT NULL DEFAULT false,
    "hasSpiderMites" BOOLEAN NOT NULL DEFAULT false,
    "potSize" REAL,
    "daysSinceRepot" INTEGER,
    "notes" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    CONSTRAINT "GrowthMetric_plantId_fkey" FOREIGN KEY ("plantId") REFERENCES "Plant" ("id") ON DELETE CASCADE ON UPDATE CASCADE
);
ANALYZE sqlite_schema;
CREATE TABLE IF NOT EXISTS "PlantJournal" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "plantId" TEXT NOT NULL,
    "timestamp" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "entryType" TEXT NOT NULL,
    "context" TEXT,
    "entry" TEXT NOT NULL,
    "referenceId" TEXT,
    "referenceType" TEXT,
    "author" TEXT,
    "tags" TEXT NOT NULL DEFAULT '[]',
    "embedding" BLOB,
    "summary" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL,
    CONSTRAINT "PlantJournal_plantId_fkey" FOREIGN KEY ("plantId") REFERENCES "Plant" ("id") ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "Harvest" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "breedingRecordId" TEXT NOT NULL,
    "harvestNumber" INTEGER NOT NULL,
    "harvestDate" DATETIME NOT NULL,
    "berryCount" INTEGER,
    "seedCount" INTEGER NOT NULL,
    "seedViability" TEXT,
    "notes" TEXT,
    "photos" TEXT NOT NULL DEFAULT '[]',
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL,
    CONSTRAINT "Harvest_breedingRecordId_fkey" FOREIGN KEY ("breedingRecordId") REFERENCES "BreedingRecord" ("id") ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "SeedBatch" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "batchId" TEXT NOT NULL,
    "harvestId" TEXT NOT NULL,
    "sowDate" DATETIME NOT NULL,
    "seedCount" INTEGER NOT NULL,
    "substrate" TEXT NOT NULL,
    "container" TEXT,
    "temperature" REAL,
    "humidity" REAL,
    "heatMat" BOOLEAN NOT NULL DEFAULT false,
    "domed" BOOLEAN NOT NULL DEFAULT true,
    "lightLevel" TEXT,
    "germinatedCount" INTEGER,
    "germinationRate" REAL,
    "firstEmergence" DATETIME,
    "lastEmergence" DATETIME,
    "status" TEXT NOT NULL DEFAULT 'SOWN',
    "notes" TEXT,
    "photos" TEXT NOT NULL DEFAULT '[]',
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL, "identifier" TEXT,
    CONSTRAINT "SeedBatch_harvestId_fkey" FOREIGN KEY ("harvestId") REFERENCES "Harvest" ("id") ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "Seedling" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "seedlingId" TEXT NOT NULL,
    "seedBatchId" TEXT NOT NULL,
    "positionLabel" TEXT,
    "emergenceDate" DATETIME NOT NULL,
    "firstTrueLeaf" DATETIME,
    "prickOutDate" DATETIME,
    "potSize" REAL,
    "leafCount" INTEGER,
    "largestLeafCm" REAL,
    "healthStatus" TEXT NOT NULL DEFAULT 'HEALTHY',
    "selectionStatus" TEXT NOT NULL DEFAULT 'GROWING',
    "selectionDate" DATETIME,
    "selectionNotes" TEXT,
    "graduatedToPlantId" TEXT,
    "graduationDate" DATETIME,
    "locationId" TEXT,
    "notes" TEXT,
    "photos" TEXT NOT NULL DEFAULT '[]',
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL,
    CONSTRAINT "Seedling_seedBatchId_fkey" FOREIGN KEY ("seedBatchId") REFERENCES "SeedBatch" ("id") ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT "Seedling_graduatedToPlantId_fkey" FOREIGN KEY ("graduatedToPlantId") REFERENCES "Plant" ("id") ON DELETE SET NULL ON UPDATE CASCADE,
    CONSTRAINT "Seedling_locationId_fkey" FOREIGN KEY ("locationId") REFERENCES "Location" ("id") ON DELETE SET NULL ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "CloneBatch" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "batchId" TEXT NOT NULL,
    "propagationType" TEXT NOT NULL,
    "sourcePlantId" TEXT,
    "externalSource" TEXT,
    "species" TEXT,
    "cultivarName" TEXT,
    "acquiredDate" DATETIME NOT NULL,
    "acquiredCount" INTEGER NOT NULL,
    "currentCount" INTEGER,
    "containerCount" INTEGER NOT NULL DEFAULT 1,
    "containerType" TEXT,
    "status" TEXT NOT NULL DEFAULT 'GROWING',
    "locationId" TEXT,
    "identifier" TEXT,
    "notes" TEXT,
    "photos" TEXT NOT NULL DEFAULT '[]',
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL,
    CONSTRAINT "CloneBatch_sourcePlantId_fkey" FOREIGN KEY ("sourcePlantId") REFERENCES "Plant" ("id") ON DELETE SET NULL ON UPDATE CASCADE,
    CONSTRAINT "CloneBatch_locationId_fkey" FOREIGN KEY ("locationId") REFERENCES "Location" ("id") ON DELETE SET NULL ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "Plant" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "plantId" TEXT NOT NULL,
    "accessionDate" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "genus" TEXT NOT NULL DEFAULT 'Anthurium',
    "section" TEXT,
    "species" TEXT,
    "hybridName" TEXT,
    "crossNotation" TEXT,
    "femaleParentId" TEXT,
    "maleParentId" TEXT,
    "generation" TEXT,
    "cloneSourceId" TEXT,
    "breeder" TEXT,
    "breederCode" TEXT,
    "vendorId" TEXT,
    "acquisitionCost" REAL,
    "propagationType" TEXT,
    "locationId" TEXT,
    "healthStatus" TEXT NOT NULL DEFAULT 'healthy',
    "conservationStatus" TEXT,
    "currentPotSize" REAL,
    "currentPotType" TEXT,
    "lastRepotDate" DATETIME,
    "coverPhotoId" TEXT,
    "breedingRecordId" TEXT,
    "marketValue" REAL,
    "isForSale" BOOLEAN NOT NULL DEFAULT false,
    "isMother" BOOLEAN NOT NULL DEFAULT false,
    "isEliteGenetics" BOOLEAN NOT NULL DEFAULT false,
    "isArchived" BOOLEAN NOT NULL DEFAULT false,
    "archivedAt" DATETIME,
    "archiveReason" TEXT,
    "cloneBatchId" TEXT,
    "notes" TEXT,
    "tags" TEXT NOT NULL DEFAULT '[]',
    "identifier" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL,
    CONSTRAINT "Plant_femaleParentId_fkey" FOREIGN KEY ("femaleParentId") REFERENCES "Plant" ("id") ON DELETE SET NULL ON UPDATE CASCADE,
    CONSTRAINT "Plant_maleParentId_fkey" FOREIGN KEY ("maleParentId") REFERENCES "Plant" ("id") ON DELETE SET NULL ON UPDATE CASCADE,
    CONSTRAINT "Plant_cloneSourceId_fkey" FOREIGN KEY ("cloneSourceId") REFERENCES "Plant" ("id") ON DELETE SET NULL ON UPDATE CASCADE,
    CONSTRAINT "Plant_vendorId_fkey" FOREIGN KEY ("vendorId") REFERENCES "Vendor" ("id") ON DELETE SET NULL ON UPDATE CASCADE,
    CONSTRAINT "Plant_locationId_fkey" FOREIGN KEY ("locationId") REFERENCES "Location" ("id") ON DELETE SET NULL ON UPDATE CASCADE,
    CONSTRAINT "Plant_breedingRecordId_fkey" FOREIGN KEY ("breedingRecordId") REFERENCES "BreedingRecord" ("id") ON DELETE SET NULL ON UPDATE CASCADE,
    CONSTRAINT "Plant_cloneBatchId_fkey" FOREIGN KEY ("cloneBatchId") REFERENCES "CloneBatch" ("id") ON DELETE SET NULL ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "FeedProduct" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "name" TEXT NOT NULL,
    "brand" TEXT,
    "category" TEXT NOT NULL,
    "ecContribution" REAL,
    "phEffect" REAL,
    "phEffectType" TEXT,
    "nitrogenN" REAL,
    "phosphorusP" REAL,
    "potassiumK" REAL,
    "calcium" REAL,
    "magnesium" REAL,
    "sulfur" REAL,
    "iron" REAL,
    "silica" REAL,
    "defaultDose" REAL,
    "maxDose" REAL,
    "applicationNotes" TEXT,
    "isActive" BOOLEAN NOT NULL DEFAULT true,
    "isInBaseline" BOOLEAN NOT NULL DEFAULT false,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL
);
CREATE TABLE IF NOT EXISTS "CareLog" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "plantId" TEXT,
    "cloneBatchId" TEXT,
    "date" DATETIME NOT NULL,
    "action" TEXT NOT NULL,
    "inputEC" REAL,
    "inputPH" REAL,
    "outputEC" REAL,
    "outputPH" REAL,
    "isBaselineFeed" BOOLEAN NOT NULL DEFAULT false,
    "feedComponents" TEXT,
    "treatmentId" TEXT,
    "dosage" REAL,
    "unit" TEXT,
    "details" TEXT,
    "nextActionDue" DATETIME,
    "performedBy" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    CONSTRAINT "CareLog_plantId_fkey" FOREIGN KEY ("plantId") REFERENCES "Plant" ("id") ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT "CareLog_cloneBatchId_fkey" FOREIGN KEY ("cloneBatchId") REFERENCES "CloneBatch" ("id") ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT "CareLog_treatmentId_fkey" FOREIGN KEY ("treatmentId") REFERENCES "Treatment" ("id") ON DELETE SET NULL ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "NegativeExample" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "plantId" TEXT,
    "messages" TEXT NOT NULL,
    "originalContent" TEXT,
    "failureType" TEXT,
    "failureNotes" TEXT,
    "correctedResponse" TEXT,
    "templateId" TEXT,
    "modelUsed" TEXT,
    "userPrompt" TEXT,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    CONSTRAINT "NegativeExample_plantId_fkey" FOREIGN KEY ("plantId") REFERENCES "Plant" ("id") ON DELETE SET NULL ON UPDATE CASCADE
);
CREATE TABLE IF NOT EXISTS "ChatLog" (
    "id" TEXT NOT NULL PRIMARY KEY,
    "plantId" TEXT NOT NULL,
    "title" TEXT,
    "messages" TEXT NOT NULL,
    "originalContent" TEXT,
    "displayContent" TEXT,
    "wasEdited" BOOLEAN NOT NULL DEFAULT false,
    "qualityScore" INTEGER,
    "retrievalWeight" REAL,
    "weightVersion" INTEGER NOT NULL DEFAULT 1,
    "confidence" TEXT NOT NULL DEFAULT 'unverified',
    "conversationDate" DATETIME NOT NULL,
    "savedAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "scoredAt" DATETIME,
    "templateId" TEXT,
    "modelUsed" TEXT,
    "tokensUsed" INTEGER,
    "embedding" BLOB,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL,
    CONSTRAINT "ChatLog_plantId_fkey" FOREIGN KEY ("plantId") REFERENCES "Plant" ("id") ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE UNIQUE INDEX "BreedingRecord_crossId_key" ON "BreedingRecord"("crossId");
CREATE INDEX "BreedingRecord_femalePlantId_idx" ON "BreedingRecord"("femalePlantId");
CREATE INDEX "BreedingRecord_malePlantId_idx" ON "BreedingRecord"("malePlantId");
CREATE INDEX "BreedingRecord_crossDate_idx" ON "BreedingRecord"("crossDate");
CREATE UNIQUE INDEX "Vendor_name_key" ON "Vendor"("name");
CREATE INDEX "Vendor_name_idx" ON "Vendor"("name");
CREATE INDEX "Purchase_vendorId_idx" ON "Purchase"("vendorId");
CREATE INDEX "Purchase_purchaseDate_idx" ON "Purchase"("purchaseDate");
CREATE UNIQUE INDEX "Location_name_key" ON "Location"("name");
CREATE INDEX "Location_name_idx" ON "Location"("name");
CREATE INDEX "Species_section_idx" ON "Species"("section");
CREATE UNIQUE INDEX "Species_genus_species_key" ON "Species"("genus", "species");
CREATE INDEX "FloweringCycle_plantId_idx" ON "FloweringCycle"("plantId");
CREATE INDEX "FloweringCycle_femaleStart_idx" ON "FloweringCycle"("femaleStart");
CREATE INDEX "FloweringCycle_maleStart_idx" ON "FloweringCycle"("maleStart");
CREATE INDEX "FloweringCycle_spatheEmergence_idx" ON "FloweringCycle"("spatheEmergence");
CREATE UNIQUE INDEX "Genetics_plantId_key" ON "Genetics"("plantId");
CREATE INDEX "Measurement_plantId_idx" ON "Measurement"("plantId");
CREATE INDEX "Measurement_measurementDate_idx" ON "Measurement"("measurementDate");
CREATE INDEX "Photo_plantId_idx" ON "Photo"("plantId");
CREATE INDEX "Photo_dateTaken_idx" ON "Photo"("dateTaken");
CREATE INDEX "Trait_plantId_idx" ON "Trait"("plantId");
CREATE INDEX "Trait_category_idx" ON "Trait"("category");
CREATE INDEX "Trait_observationDate_idx" ON "Trait"("observationDate");
CREATE INDEX "GrowthMetric_plantId_idx" ON "GrowthMetric"("plantId");
CREATE INDEX "GrowthMetric_date_idx" ON "GrowthMetric"("date");
CREATE INDEX idx_flowering_female_start
  ON FloweringCycle(femaleStart DESC) WHERE femaleStart IS NOT NULL;
CREATE INDEX idx_flowering_male_start
  ON FloweringCycle(maleStart DESC) WHERE maleStart IS NOT NULL;
CREATE INDEX idx_location_name
  ON Location(name);
CREATE INDEX idx_vendor_name
  ON Vendor(name);
CREATE INDEX "PlantJournal_plantId_timestamp_idx" ON "PlantJournal"("plantId", "timestamp");
CREATE INDEX "PlantJournal_entryType_idx" ON "PlantJournal"("entryType");
CREATE INDEX "PlantJournal_context_idx" ON "PlantJournal"("context");
CREATE INDEX "Harvest_breedingRecordId_idx" ON "Harvest"("breedingRecordId");
CREATE INDEX "Harvest_harvestDate_idx" ON "Harvest"("harvestDate");
CREATE UNIQUE INDEX "Harvest_breedingRecordId_harvestNumber_key" ON "Harvest"("breedingRecordId", "harvestNumber");
CREATE UNIQUE INDEX "SeedBatch_batchId_key" ON "SeedBatch"("batchId");
CREATE INDEX "SeedBatch_harvestId_idx" ON "SeedBatch"("harvestId");
CREATE INDEX "SeedBatch_sowDate_idx" ON "SeedBatch"("sowDate");
CREATE INDEX "SeedBatch_status_idx" ON "SeedBatch"("status");
CREATE UNIQUE INDEX "Seedling_seedlingId_key" ON "Seedling"("seedlingId");
CREATE UNIQUE INDEX "Seedling_graduatedToPlantId_key" ON "Seedling"("graduatedToPlantId");
CREATE INDEX "Seedling_seedBatchId_idx" ON "Seedling"("seedBatchId");
CREATE INDEX "Seedling_selectionStatus_idx" ON "Seedling"("selectionStatus");
CREATE INDEX "Seedling_emergenceDate_idx" ON "Seedling"("emergenceDate");
CREATE INDEX "Seedling_locationId_idx" ON "Seedling"("locationId");
CREATE INDEX "BreedingRecord_crossCategory_idx" ON "BreedingRecord"("crossCategory");
CREATE UNIQUE INDEX "Plant_plantId_key" ON "Plant"("plantId");
CREATE UNIQUE INDEX "Plant_identifier_key" ON "Plant"("identifier");
CREATE INDEX "Plant_plantId_idx" ON "Plant"("plantId");
CREATE INDEX "Plant_vendorId_idx" ON "Plant"("vendorId");
CREATE INDEX "Plant_locationId_idx" ON "Plant"("locationId");
CREATE INDEX "Plant_section_idx" ON "Plant"("section");
CREATE INDEX "Plant_isArchived_idx" ON "Plant"("isArchived");
CREATE INDEX "Plant_cloneSourceId_idx" ON "Plant"("cloneSourceId");
CREATE INDEX "Plant_breedingRecordId_idx" ON "Plant"("breedingRecordId");
CREATE INDEX "Plant_cloneBatchId_idx" ON "Plant"("cloneBatchId");
CREATE UNIQUE INDEX "CloneBatch_batchId_key" ON "CloneBatch"("batchId");
CREATE UNIQUE INDEX "CloneBatch_identifier_key" ON "CloneBatch"("identifier");
CREATE INDEX "CloneBatch_batchId_idx" ON "CloneBatch"("batchId");
CREATE INDEX "CloneBatch_sourcePlantId_idx" ON "CloneBatch"("sourcePlantId");
CREATE INDEX "CloneBatch_status_idx" ON "CloneBatch"("status");
CREATE INDEX "CloneBatch_locationId_idx" ON "CloneBatch"("locationId");
CREATE UNIQUE INDEX "SeedBatch_identifier_key" ON "SeedBatch"("identifier");
CREATE UNIQUE INDEX "FeedProduct_name_key" ON "FeedProduct"("name");
CREATE INDEX "FeedProduct_category_idx" ON "FeedProduct"("category");
CREATE INDEX "FeedProduct_isActive_idx" ON "FeedProduct"("isActive");
CREATE INDEX "CareLog_plantId_idx" ON "CareLog"("plantId");
CREATE INDEX "CareLog_cloneBatchId_idx" ON "CareLog"("cloneBatchId");
CREATE INDEX "CareLog_date_idx" ON "CareLog"("date");
CREATE INDEX "CareLog_action_idx" ON "CareLog"("action");
CREATE INDEX "ChatLog_plantId_idx" ON "ChatLog"("plantId");
CREATE INDEX "ChatLog_savedAt_idx" ON "ChatLog"("savedAt");
CREATE INDEX "ChatLog_qualityScore_idx" ON "ChatLog"("qualityScore");
CREATE INDEX "ChatLog_confidence_idx" ON "ChatLog"("confidence");
CREATE INDEX "NegativeExample_plantId_idx" ON "NegativeExample"("plantId");
CREATE INDEX "NegativeExample_failureType_idx" ON "NegativeExample"("failureType");
CREATE INDEX "NegativeExample_createdAt_idx" ON "NegativeExample"("createdAt");
COMMIT;
