INSERT INTO Photo VALUES('cmhpqgm8z002lwjax8kc0dzv4','cmgsezkiu001pgw7466lruqng','/uploads/photos/ANT-2025-0015_1762573009185.jpeg','/uploads/thumbnails/ANT-2025-0015_1762573009185_thumb.jpeg',1762549460000,'juvenile','whole_plant','{"width":5712,"height":4284,"format":"jpeg","space":"srgb","hasAlpha":false,"orientation":6,"exif":{"dateTimeOriginal":"2025-11-07T21:04:20.000Z","make":"Apple","model":"iPhone 16 Pro Max","software":"26.1","lensModel":"iPhone 16 Pro Max back triple camera 6.765mm f/1.78","focalLength":6.764999865652793,"fNumber":1.7799999713880652,"iso":320,"exposureTime":0.016666666666666666,"flash":16,"gpsLatitude":26.127744444444446,"gpsLongitude":-80.14405833333333}}',NULL,replace(replace('Observations:\r\nDocumenting current morphological expression of TC Delta Force specimen. Plant showing characteristic triangular leaf architecture with moderate sinus flattening - notably less extreme than documented ruler flat phenotype of original Nock selection, consistent with suspected somaclonal variation from tissue culture propagation.\r\nLeaf texture remains leathery with good substance. Growth habit compact and upright. Recent spadix development (documented in previous photos) indicates sexual maturity and breeding readiness.\r\nNext Steps:\r\n		Compare sinus morphology to NSE/SKG OG offset specimens if acquired\r\n		Continue monitoring for pest resistance and vigor characteristics\r\n		Evaluate as cross-sectional breeding candidate with Cardiolonchium collection (particularly Crystallinum, Magnificum, Red Crystal lines)\r\nBreeding Notes:Section Andiphilum. Parents: A. clarinervium  A. pedatoradiatum (Steve Nock, Ree Gardens, 1990s). Clone-only cultivar via TC. Potential somaclonal drift from original phenotype. Retain for comparative documentation and experimental breeding work','\r',char(13)),'\n',char(10)),1762573009571);
