INSERT INTO Photo VALUES('cmj4ef0sy0019w0bog8ktnpbs','cmgsezkjj004hgw741plapojf','/uploads/photos/ANT-2025-0065_1765636554519.jpeg','/uploads/thumbnails/ANT-2025-0065_1765636554519_thumb.jpeg',1765633538000,NULL,'leaf','{"width":3024,"height":4032,"format":"jpeg","space":"srgb","hasAlpha":false,"orientation":1,"exif":{"dateTimeOriginal":"2025-12-13T13:45:38.000Z","make":"Apple","model":"iPhone 16 Pro Max","software":26.2,"lensModel":"iPhone 16 Pro Max back triple camera 6.765mm f/1.78","focalLength":"6.8 mm","fNumber":1.8,"iso":100,"exposureTime":"1/81","flash":"Off, Did not fire","gpsLatitude":26.1278,"gpsLongitude":-80.144089}}',NULL,'This leaf started to emerge in the grow tent which suffered from low VPD potentially causing the stippling then moved the plant to a protected area shaded on balcony which appeared to slow and eventually stop the creation expansion of more marks on the leaf. It appears that expansion has slowed and approaching hardening and some darkening no  sign of dramatic variegation yet but too soon to tell. ',1765636554707);
