INSERT INTO Photo VALUES('cmj4hjd2q001vw0boxh0pqfse','cmgsezkjc003rgw74o897pydc','/uploads/photos/ANT-2025-0052_1765641795881.jpeg','/uploads/thumbnails/ANT-2025-0052_1765641795881_thumb.jpeg',1765495471000,'juvenile','leaf','{"width":4032,"height":3024,"format":"jpeg","space":"srgb","hasAlpha":false,"orientation":6,"exif":{"dateTimeOriginal":"2025-12-11T23:24:31.000Z","make":"Apple","model":"iPhone 16 Pro Max","software":26.2,"lensModel":"iPhone 16 Pro Max back triple camera 2.22mm f/2.2","focalLength":"2.2 mm","fNumber":2.2,"iso":40,"exposureTime":"1/122","flash":"On, Fired","gpsLatitude":26.127894,"gpsLongitude":-80.144119}}',NULL,'New leaf appears to have a more fused sinus/lobes. Observe a small whole next to midrib. Will monitor to see how this impacts expansion and development ',1765641796082);
INSERT INTO Photo VALUES('cmj5sbxeo001mut2itd14jcwb','cmgsezkjc003rgw74o897pydc','/uploads/photos/ANT-2025-0052_1765720390939.jpg','/uploads/thumbnails/ANT-2025-0052_1765720390939_thumb.jpg',1765731600000,'mature','leaf','{"width":4032,"height":3024,"format":"jpeg","space":"srgb","hasAlpha":false,"orientation":6,"exif":{"dateTimeOriginal":null,"make":null,"model":null,"software":null,"lensModel":null,"focalLength":null,"fNumber":null,"iso":null,"exposureTime":null,"flash":null,"gpsLatitude":null,"gpsLongitude":null}}',NULL,'This is the first leaf that emerged from catophyl. I moved it to Grove Center two to avoid the low VPD issues. Im seeing across other plants. Expansion is looking healthy with round petiole. Belief developed a whole extremely early and development as a key observation to track. It does appear like there is some very faint stippling on other lobe that looks consistent with the VPD issues as this was in the Grant prior lobes are fusing. This new leaf looks like there will be additional fusing verse the last mature leaf. A few things to consider and track are the tear in the leaf and what happens with that as well as looking for VPD related symptoms.',1765720391137);
INSERT INTO Photo VALUES('cmj5sbxv8001out2iiuytiasu','cmgsezkjc003rgw74o897pydc','/uploads/photos/ANT-2025-0052_1765720391528.jpg','/uploads/thumbnails/ANT-2025-0052_1765720391528_thumb.jpg',1765731600000,'mature','leaf','{"width":4032,"height":3024,"format":"jpeg","space":"srgb","hasAlpha":false,"orientation":6,"exif":{"dateTimeOriginal":null,"make":null,"model":null,"software":null,"lensModel":null,"focalLength":null,"fNumber":null,"iso":null,"exposureTime":null,"flash":null,"gpsLatitude":null,"gpsLongitude":null}}',NULL,'This is the first leaf that emerged from catophyl. I moved it to Grove Center two to avoid the low VPD issues. Im seeing across other plants. Expansion is looking healthy with round petiole. Belief developed a whole extremely early and development as a key observation to track. It does appear like there is some very faint stippling on other lobe that looks consistent with the VPD issues as this was in the Grant prior lobes are fusing. This new leaf looks like there will be additional fusing verse the last mature leaf. A few things to consider and track are the tear in the leaf and what happens with that as well as looking for VPD related symptoms.',1765720391732);
INSERT INTO Photo VALUES('cmj5se54b001qut2i809q2apl','cmgsezkja003hgw74cry941wr','/uploads/photos/ANT-2025-0047_1765720494237.jpg','/uploads/thumbnails/ANT-2025-0047_1765720494237_thumb.jpg',1765731600000,'mature','base','{"width":4032,"height":3024,"format":"jpeg","space":"srgb","hasAlpha":false,"orientation":6,"exif":{"dateTimeOriginal":null,"make":null,"model":null,"software":null,"lensModel":null,"focalLength":null,"fNumber":null,"iso":null,"exposureTime":null,"flash":null,"gpsLatitude":null,"gpsLongitude":null}}',NULL,'New mature leaf is about to emerge from its sheath. There are also two in flow that have decided to emerge at the same time one from a prior leaf that I did not expect and one from the current mature leaf that is expected. Spathe has not opened. I predict we are about 3 to 7 days from that spade XP exposed.  ',1765720494443);
INSERT INTO Photo VALUES('cmj5sfdl7001sut2izg68zae2','cmgsezkja003hgw74cry941wr','/uploads/photos/ANT-2025-0047_1765720551874.jpg','/uploads/thumbnails/ANT-2025-0047_1765720551874_thumb.jpg',1765731600000,'mature','whole_plant','{"width":4032,"height":3024,"format":"jpeg","space":"srgb","hasAlpha":false,"orientation":6,"exif":{"dateTimeOriginal":null,"make":null,"model":null,"software":null,"lensModel":null,"focalLength":null,"fNumber":null,"iso":null,"exposureTime":null,"flash":null,"gpsLatitude":null,"gpsLongitude":null}}',NULL,'Overhead view to show the two in fluorescence that have been emerging',1765720552075);
INSERT INTO Photo VALUES('cmj5sj5i5001uut2iscejljbm','cmgsezkja003hgw74cry941wr','/uploads/photos/ANT-2025-0047_1765720728021.jpg','/uploads/thumbnails/ANT-2025-0047_1765720728021_thumb.jpg',1765731600000,'mature','whole_plant','{"width":4032,"height":3024,"format":"jpeg","space":"srgb","hasAlpha":false,"orientation":6,"exif":{"dateTimeOriginal":null,"make":null,"model":null,"software":null,"lensModel":null,"focalLength":null,"fNumber":null,"iso":null,"exposureTime":null,"flash":null,"gpsLatitude":null,"gpsLongitude":null}}',NULL,'Most recent leaf detail expansion size up was tremendous as noted before there are some mechanical marks. There is a slight necrosis at leaf tip potentially due to curation water droplets. Lobes did show typical low VPD symptoms that look remarkably similar to spider mites.  Appears that the stipling is fading as leaf matures.  Overall, I give this leaf 10 out of 10 for growth eight out of 10 for mechanical and a 6/10 for leaf surface',1765720728222);
INSERT INTO Photo VALUES('cmj5tb3oy0026ut2id7grwfu5','cmgsezkjb003lgw74nmxn50qw','/uploads/photos/ANT-2025-0049_1765722031919.jpeg','/uploads/thumbnails/ANT-2025-0049_1765722031919_thumb.jpeg',1765657804000,NULL,'whole_plant','{"width":8064,"height":6048,"format":"jpeg","space":"srgb","hasAlpha":false,"orientation":6,"exif":{"dateTimeOriginal":"2025-12-13T20:30:04.000Z","make":"Apple","model":"iPhone 16 Pro Max","software":26.2,"lensModel":"iPhone 16 Pro Max back triple camera 6.765mm f/1.78","focalLength":"6.8 mm","fNumber":1.8,"iso":400,"exposureTime":"1/40","flash":"Off, Did not fire","gpsLatitude":26.127761,"gpsLongitude":-80.144042}}',NULL,'These photos are all part of yesterdays division and offset task. Main plant was divided into mother, two divisions, a mature size and two offsets.  Key things to look for and monitor is particularly larger, offset and smallest mature. Plant division broke off verse being cut. One of these photos does show the breakpoint. Overall project appears successful moved into my 4.5 mix. 4 part TFF, 2 parts coco coir, 2 perlite grade three, 2 2 parts medium pine park 1 part small pine bark, 1 part hardwood charcoal 1 part Pon. Everything was inoculated with great white mikorhyzeae ',1765722032242);
